def group_cats(tbl, key, numkey='ratio', silent=False):
    groups = {}
    for item in tbl:
        t = item['ticker']
        val = item.get(numkey, 0.)
        c = item.get(key)
        if c not in groups:
            groups[c] = 0.
        groups[c] += val  # *100
    try:
        groups = sorted(groups.items(), reverse=True, key=lambda item: (item[1], item[0]))
        if not silent:
            _groups = [[g, n * 100] for g, n in groups]
            print(tabulate(_groups, headers=['Group', 'Amounts']))
    except:
        return list(groups.items())
    else:
        return groups


def plot_pie(groups, colors=None, fgax=None):
    if fgax is None:
        fgax = plt.subplots()

    groups = sorted(groups, reverse=True, key=lambda item: (item[1], item[0] is None, item[0]))
    labels, sizes = zip(*groups)
    sizes = [100 * x for x in sizes]
    explode = [0] * len(labels)
    cs = colors if colors is None else [colors.get(label) for label in labels]
    
    #     print(cs)
    fg, ax = fgax
    plt.sca(ax)
    plt.pie(sizes, explode=explode, labels=labels, autopct='%1.1f%%',
            colors=cs,
            #         shadow=True,
            startangle=0);
    plt.tight_layout()
    return fgax

def find(tbl, **items):
    for item in tbl:
        for k,v in items.items():
            if k in item and item[k] != v:
                break
        else:
            return item

def replace(tbl, **items):
    for item in tbl:
        for k,reps in items.items():
            if k in item and item[k] in reps:
                item[k] = reps[item[k]]
    return tbl

def plot_piece_pie(tbl, colors=None, groupkey='sector', tkkey='ticker', numkey='ratio', silent=True, explode=0.05,
                   fgax=None, figsize=(9,5)):
    groups = group_cats(tbl, groupkey, silent=silent)
    if colors is None:
        colors = {sec: f'C{i}' for i, (sec, n) in enumerate(groups)}
    order, tots = zip(*groups)
    tks, secs, slcs = zip(*[[item.get(tkkey), item.get(groupkey), item.get(numkey) * 100] for item in
                            sorted(tbl, key=lambda item: (order.index(item.get(groupkey)), -item.get(numkey)))])
    explode = [explode] * len(secs)
    cs = [colors.get(sec,'w') for sec in secs]
    # ocs = [colors.get(o) for o in order]
    if fgax is None:
        fgax = plt.subplots(figsize=figsize)
    fg, ax = fgax
    plt.sca(ax)
    plt.pie(slcs, explode=explode, labels=tks, autopct='%1.1f%%',
            colors=cs, startangle=0);
    plt.legend(handles=[mpatches.Patch(color=colors.get(o, 'w'), label=f'{o} ({t*100:1.1f}%)') for o, t in groups],
               loc='center left', bbox_to_anchor=(1.1, 0.5))
    plt.tight_layout();
    return fgax


def percent_change(new, old):
    change = {tk: 100 * (new[tk] / r - 1) for tk, r in old.items() if r > 0}
    return change


def process_tsv(raw, cols, typs=None):
    if typs is None:
        typs = [str]*len(cols)
    terms = [row.split('\t') for row in raw.split('\n')] 
    tbl = []
    for row in terms:
        info = {}
        for term, col, typ in zip(row, cols, typs):
            if col is not None:
                info[col] = typ(term) if typ is not None else term
        tbl.append(info)
    return tbl

def parse_number(x):
    x = x.strip().replace(',', '')
    if not len(x):
        return 0.
    return float(x)
def parse_percent(x):
    x = x.strip().replace(',', '.')
    if x.endswith('%'):
        x = x[:-1]
    return parse_number(x)/100

def remove_parts(tbl, keys):
    bad = set()
    for i, item in enumerate(tbl):
        for k, vs in keys.items():
            if k in item and item[k] in vs:
                bad.add(i)
                break
    return [row for i, row in enumerate(tbl) if i not in bad]

def ticker_name_extractor(x):
    tk, name = x.get('ticker', ''), x.get('name', '').lower()
    tk = tk.split('.')[0].lower()
    return f'{tk} {name}'

def similarity_scores(tbl1, tbl2, ext1, ext2, metric):
    feat1, feat2 = list(map(ext1, tbl1)), list(map(ext2, tbl2))
    return np.array([[metric(f1, f2) for f2 in feat2] for f1 in feat1])

def best_matchings(scores, tbl1, tbl2):
    return [[scores[i,j], tbl1[i], tbl2[j]] for i,j in zip(*linear_sum_assignment(-scores))]

def join_tables(tbl1, tbl2):
    return [{**x1, **x2} for x1, x2 in zip(tbl1, tbl2)]

def fidelity_portfolio(raw, cols=None, typs=None, suffix=None):
    if cols is None:
        cols = ['ticker', 'name', 'ratio']
    if typs is None:
        typs = [str, str, parse_percent]
        if suffix is not None:
            typs[0] = lambda x: f'{x}.{suffix}'
    return process_tsv(raw, cols, typs)

def update_table(tbl, **items):
    for row in tbl:
        row.update(items)
    return tbl

